import React from 'react';

import {Card} from '../card/card.component'

import './card-list.style.css';

export const CardList = (props) => {
    return <div className='card-list'>
            <table>
            <thead>
                <tr>
                <td>Confirmed</td>
                <td>Deaths</td>
                <td>Recovered</td>
                <td>Active</td>
                </tr>
            </thead>
            { props.list.map(({attributes}) => (
              <Card key={attributes.OBJECTID} attributes={attributes}/>
          ))}
          </table>
    </div>
}
